(7, '', '1', 'BẢO TRÌ CẬP NHẬT PHIÊN BẢN 0.0.2', ' Chào các bạn,<br />\r\n- Hiện tại quá trình nâng cấp phiên bản 0.0.2 đã hoàn thành 50%.<br />\r\n- Bật mí bản này update tiến hóa, hệ pokemon, khắc hệ v.v, GEN 8.<br />\r\n- Thời gian dự kiến kết thúc bảo trì ngày 17/4/2020.<br />\r\n<br />\r\n cám ơn các bạn.<br />\r\n', 1586686638, 0, 0, 0, 1, 1586707335),
(2, '1', '3', '', 'Hóngggggggggggg', 1586487022, 0, 0, 0, 0, 0),
(4, '', '1', 'HƯỠNG DẪN CHO NGƯỜI MỚI CHƠI', ' Chào các huấn luyện viên,<br />\r\n Để hỗ trợ cho người chơi mới một cách tốt nhất thì mình xin viết một số thông tin cho mọi người nắm bắt rõ hơn về trò chơi [b]PokeMon biến hình[/b].<br />\r\n<br />\r\n [b]I, Tài khoản[/b]<br />\r\n<br />\r\n- Bạn có thể đăng kí tài khoản mới khi vào giao diện đăng nhập của trò chơi.<br />\r\n- Cách đăng kí :<br />\r\n+ Vào giao diện game => TÀI KHOẢN KHÁC => Nhập tài khoản mật khẩu rồi ấn nút [ĐĂNG KÍ]<br />\r\n<br />\r\n [b]II, Bắt pokemon khởi đầu[/b]<br />\r\n- Khi hoàn thành một vài nhiệm vụ đầu tiên bạn sẽ được chuyển đến nhiệm vụ bắt pokemon khởi đàu.<br />\r\n- Để bắt được PokeMon thì các bạn hãy chạm vào pokemon mà cần bắt trên màn hình => vào rương đồ => chọn bóng => sử dụng.<br />\r\n<br />\r\n2, Một số kinh nghiệm bắt pokemon.<br />\r\n- Pokemon khởi đầu tỉ lệ bắt rất dễ dàng, nhưng từ level sau trở đi là sẽ khá khó khăn nhé.<br />\r\n- Để bắt chuẩn nhất thì chúng ta có công thức bắt :<br />\r\n+ HP pokemon càng thấp tỉ lệ càng cao.<br />\r\n* Công thức bắt = tỉ lệ HP quái + % bóng.<br />\r\n<br />\r\n [b]III, Tiềm năng, kĩ năng pokemon[/b]<br />\r\n- Mỗi lần lên cấp bạn sẽ nhận được 10 điểm tiềm năng, 1 điểm kĩ năng.<br />\r\n- Điểm tiềm năng vô cùng quan trọng tới sự phát triển và sức mạnh của PokeMon ! Tiềm năng cộng theo lối chơi của các bạn ( Chơi vật lí , chơi phép, hay chơi hỗ trợ) , mỗi lần lên cấp bạn sẽ nhận được 10 điểm tiềm năng của PokeMon. Nếu bạn chơi sát thương vật lí : hãy cộng toàn bộ vào sức mạnh và trí tuệ, nếu bạn chơi phép hay cộng vào thân pháp và khéo léo, còn bạn chơi hỗ trợ hãy cộng vào thể lực và thân pháp, ngoài ra bạn có thể cộng sao cho phù hợp với lối chơi của các bạn.<br />\r\n<br />\r\n- Mỗi khi lên cấp pokemon bạn sẽ nhận được một điểm kĩ năng. Kĩ năng pokemon có 3 loại :<br />\r\n+ sát thương phép <br />\r\n+ Sát thương vật lí  <br />\r\n+ Kĩ năng hỗ trợ  <br />\r\n- Nếu các bạn chơi lối chơi nào thì hãy chọn đúng kĩ năng của lối chơi đấy ! <br> Ưu điểm của kĩ năng vật lí : <br />\r\n- Sát thương mạnh nhờ tỉ lệ chí mạng, săn boss , up quái dễ dàng PK cũng ổn định , nhưng cũng có nhiều nhược điểm <br />\r\n+ Sát thương phép rất mạnh về kĩ năng , thích hợp cho việc PK , nhưng thời gian hồi rất lâu - Kĩ năng hỗ trợ : Gây choáng , hồi máu , hồi máu cho người khác , đóng băng , bỏng , giữ chân v.v <br />\r\n- Mỗi khi đạt cấp độ 5-10-15-20-25-30-35-40-45-50-55... hãy tới gặp Kina để học kĩ năng miễn phí ! Hãy nhớ đọc kĩ đi nhé khẻo chọn sai kĩ năng ! Ngoài ra bạn có thể học kĩ năng thông qua học sách <br />\r\n- Sách có thể kiếm được từ săn BOSS , ghép từ mảnh giấy vụn v.v<br />\r\n\r\n[b]III, PK đeo cờ, mời PVP [/b]\r\n1, PK cờ <br> Để PK cờ các bạn cần đeo cờ lên ! Riêng nếu bạn đeo cờ đồ sát thì mọi người chơi có thể đánh bạn và bạn cũng có thể đánh người ta chết mà không cần đeo cờ <br> 2, PK thách đấu <br> - Để PK thách đấu các bạn cần chọn người chơi sau đó ấn nút Thách đấu chọn mức cược từ 10-100.000.000 xu ! Nếu hai bên đồng ý sẽ tiến hành đánh nhau ! Người thắng cuộc sẽ nhận được 95% số tiền chiến thắng.\r\n\r\n[b]IV, Hệ thống rương, kho đồ[/b]\r\n1, Rương trên người <br> - Rương trên người là rương khi bạn mở túi đồ sẽ có ! Rương có chức chứa 10 ô ( ngoài ra bạn có thể nâng cấp rương đồ) <br> - Khi rương đồ đầy sẽ không thể nhặt các vật phẩm từ đất rơi ra <br> - Bạn có thể bỏ bớt đồ vào kho đồ <br> 2, Rương đồ tại NPC <br> - Rương đồ là nơi bạn cất pokemon , lẫn item bỏ vào kho, bạn sẽ có 20 ô ngoài ra cũng có thể nâng cấp lên ! <br> 3, Gửi xu <br> - Số xu mang tối thiểu trên người là 2.000.000.000 xu, và gửi vào rương tối đa là 500.000.000 xu', 1586492039, 0, 0, 0, 1, 1586492039),
(5, '', '1', 'Thuộc Tính Hệ & Sát thương Hệ', ' Chào các bạn,<br />\r\n Để hiểu rõ hơn về thế giới pokemon MMO thì chúng ta sẽ tìm hiểu một số thông số sau của pokemon nhé.<br />\r\n [b]1, Lưu ý[/b]<br />\r\n- Thuộc tính áp dụng cả 2 hệ.<br />\r\n- Nếu pokemon bạn có 2 hệ thì sẽ tác dụng luôn cả 2 hệ nhé.<br />\r\n<br />\r\n[b] 2, Chỉ số hệ pokemon [/b]<br />\r\n[img]http://pokeburn.com/sql/load/fix.png[/img]<br />\r\n\r\n<br />\r\n[b]Công sức tính chỉ số hệ nhận thêm được vào chỉ số gốc :[/b]<br />\r\n<br />\r\n- Chỉ số gốc = [b]level Pokemon[/b]*([b] chỉ số mắc định của pokemon trong pokemon dex[/b]/5*[b]% thuộc tính bên trên[/b]).<br />\r\n<br />\r\n[b] 3, Sát thương hệ [/b]<br />\r\n<br />\r\n- Để tham khảo sát thương hệ các bạn xem bảng dưới đây :<br />\r\n+ Ví dụ hệ Fire khi đánh hệ Fire sẽ giảm -50% sức đánh của đòn.<br />\r\n+ Ví dụ hệ Water khi đánh hệ Fire sẽ được x2 đòn đánh.<br />\r\n+ Khi hệ Ghost đánh hệ Normal sẽ không gây sát thương.<br />\r\n<br />\r\n[img]http://pokeburn.com/sql/eff/he.png[/img]<br />\r\n', 1586571795, 0, 0, 0, 1, 1586571795),
(18, '', '1', 'KHAI MỞ MÁY CHỦ WORLD', ' Chào các bạn,<br />\r\n Máy chủ World sẽ mở vào 10h17/04/2020.<br />\r\n Kèm theo đó là rất nhiều các hoạt động thú vị như đua top, v.v<br />\r\n Hẹn gặp lại các bạn vào ngày 17/04.2020', 1586912840, 0, 0, 0, 1, 1587122745),
