(16, '', '1', 'Hiệu ứng kĩ năng PokeMon', '<br />\r\n Chào các bạn,<br />\r\n Kĩ năng ngoài gây sát thương phép và sát thương vật lí ra. Một số kĩ năng từ level 20 trở sẽ có một số hiệu ứng kĩ năng đặt biệt.<br />\r\n<br />\r\n1, Hiệu ứng choáng<br />\r\n- Gây choáng cho đối phương.<br />\r\n+ Cấm đánh.<br />\r\n+ Cấm di chuyển.<br />\r\n<br />\r\n2, Hiệu ứng đóng băng<br />\r\n- Đóng băng đối thủ.<br />\r\n+ Cấm đi.<br />\r\n+ Cấm đánh.<br />\r\n+ Mỗi giây mất %hp.<br />\r\n<br />\r\n3, Hiệu ứng bỏng.<br />\r\n- Gây bỏng cho đối phương.<br />\r\n+ Mỗi giây mất %hp.<br />\r\n<br />\r\n4, Hiệu ứng trói chân.<br />\r\n- Trói chân đối phương lại.<br />\r\n+ Cấm di chuyển trong một khoảng thời gian.<br />\r\n<br />\r\n5, Hiệu ứng hồi máu.<br />\r\n- Hồi máu cho bản thân.<br />\r\n+ Mỗi giây hồi %hp của bản thân.<br />\r\n<br />\r\n6, Hiệu ứng hỗ trợ.<br />\r\n- Hồi máu cho người khác ( nếu chết sẽ được hồi sinh).<br />\r\n+ Mỗi giây hồi %hp của người cần hỗ trợ.<br />\r\n', 1586833971, 0, 0, 0, 1, 1586835547),
