(1, 1, '{\r\n    \"ten\": \"Chào mừng\",\r\n    \"text\": \"...\",\r\n    \"text2\": \"Chào mừng cháu đến với thế giới PokeMon, xin tự giới thiệu ta là Osk, tiến sĩ của mọi loại pokemon. Hân hạnh được gặp cháu.\",\r\n    \"npc\": \"125\",\r\n    \"loai\": \"giaotiep\",\r\n    \"pokemon\": \"0\",\r\n    \"can\": \"0\",\r\n    \"xu\": \"1000\",\r\n    \"exp\": \"100\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"\"\r\n}'),
(2, 2, '{\r\n    \"ten\": \"Chuyến hành trình\",\r\n    \"text\": \"...\",\r\n    \"text2\": \"Chắc cháu đang nóng lòng cho chuyến hành trình của mình lắm rồi đúng không ? Hãy cầm lấy quả bóng pokeball này của ta rồi sử dụng nhé.\",\r\n    \"npc\": \"125\",\r\n    \"loai\": \"giaotiep\",\r\n    \"pokemon\": \"\",\r\n    \"can\": \"\",\r\n    \"xu\": \"1000\",\r\n    \"exp\": \"100\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"52:1\",\r\n    \"item\": \"\"\r\n}'),
(3, 3, '{\n    \"ten\": \"Bạn đồng hành\",\n    \"text\": \"Giờ cháu hãy mở rương đồ rồi sử dụng quả bóng xem có điều gì bất ngờ.\",\n    \"text2\": \"Ta trông người bạn đồng hành của cháu cũng tuyệt vời đấy.\",\n    \"npc\": \"125\",\n    \"loai\": \"dungvp\",\n    \"pokemon\": \"52\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"100\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(4, 4, '{\r\n    \"ten\": \"Chiến đấu\",\r\n    \"text\": \"...\",\r\n    \"text2\": \"Giờ cháu hãy vào HÀNH TRANG => POKEMON => rồi ấn nút CHIẾN ĐẤU đi nào.\",\r\n    \"npc\": \"125\",\r\n    \"loai\": \"giaotiep\",\r\n    \"pokemon\": \"\",\r\n    \"can\": \"\",\r\n    \"xu\": \"100\",\r\n    \"exp\": \"100\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"\"\r\n}'),
(5, 5, '{\r\n    \"ten\": \"Kĩ năng\",\r\n    \"text\": \"...\",\r\n    \"text2\": \"AAA !! gì mà hùng hổ vậy ... nhưng đã dán kĩ năng lên màn hình chưa mà trông ghê gớm thế ? Nào nếu chưa dán kĩ năng lên màn hình thì vào mục PokeMon => kĩ năng rồi dán kĩ năng lên.\",\r\n    \"npc\": \"126\",\r\n    \"loai\": \"giaotiep\",\r\n    \"pokemon\": \"\",\r\n    \"can\": \"\",\r\n    \"xu\": \"100\",\r\n    \"exp\": \"100\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"\"\r\n}'),
(6, 6, '{\n    \"ten\": \"So Tài\",\n    \"text\": \"Cậu có muốn so tài với ta không ? Hãy thách đấu với ta thử coi.\",\n    \"text2\": \"Chà ! Mới làm quen mà cậu đã khá lắm. Nhưng ta còn nhương tay đó. Mai mốt ra ngoài thế giới kia không ai nương tay như ta đâu.\",\n    \"npc\": \"126\",\n    \"loai\": \"gym\",\n    \"pokemon\": \"1\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(7, 7, '{\r\n    \"ten\": \"Còn thiếu\",\r\n    \"text\": \"...\",\r\n    \"text2\": \"Ta nghĩ cháu còn thiếu một chút gì nữa để chuẩn bị cho chuyến hành trình. Cháu hãy thử ghé lại thị trấn StartFall để sắm sửa cho mình chút đồ đi nào.\",\r\n    \"npc\": \"125\",\r\n    \"loai\": \"giaotiep\",\r\n    \"pokemon\": \"\",\r\n    \"can\": \"\",\r\n    \"xu\": \"1000\",\r\n    \"exp\": \"1000\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"\"\r\n}'),
(8, 8, '{\r\n    \"ten\": \"StartFall\",\r\n    \"text\": \"...\",\r\n    \"text2\": \"Chào mừng cậu nhóc tới với thị trấn StartFall,  ta đã nghe kể qua về cậu từ Osk. Cậu tới đây để sắm sửa chút đồ cho cuộc hành trình đúng chứ ! Yên tâm ! Thị trấn sẽ có đủ những thứ cho cậu cần.\",\r\n    \"npc\": \"29\",\r\n    \"loai\": \"giaotiep\",\r\n    \"pokemon\": \"\",\r\n    \"can\": \"\",\r\n    \"xu\": \"200\",\r\n    \"exp\": \"200\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"\"\r\n}'),
(9, 9, '{\r\n    \"ten\": \"Hồi máu\",\r\n    \"text\": \"..\",\r\n    \"text2\": \"Chào anh, em là Nurse. Em có thể giúp anh hồi máu rất nhanh nếu gặp em. PokeMon anh sẽ bị chết nếu như HP về 0. Hãy gặp em khi cần thiết nhé.\",\r\n    \"npc\": \"27\",\r\n    \"loai\": \"giaotiep\",\r\n    \"pokemon\": \"\",\r\n    \"can\": \"\",\r\n    \"xu\": \"200\",\r\n    \"exp\": \"200\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"\"\r\n}'),
(10, 10, '{\r\n    \"ten\": \"Nâng cấp\",\r\n    \"text\": \"..\",\r\n    \"text2\": \"Cậu đã bao giờ nghe về những thứ sức mạnh phi thường chưa ? Haha, đừng sợ... Ta có thể có khả năng làm cho các món đồ của cậu trở nên mạnh mẽ hơn. Hãy tới gặp ta khi cậu cần, ta sẽ giúp cậu cường hóa những món đồ trở nên đẹp và mạnh hơn.\",\r\n    \"npc\": \"35\",\r\n    \"loai\": \"giaotiep\",\r\n    \"pokemon\": \"\",\r\n    \"can\": \"\",\r\n    \"xu\": \"200\",\r\n    \"exp\": \"200\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"\"\r\n}'),
(11, 11, '{\n    \"ten\": \"Tạp hóa\",\n    \"text\": \"...\",\n    \"text2\": \"Nếu cậu định mua bóng, mua những vật phẩm,... thì gặp tôi là đúng người rồi đó. Cửa hàng tôi chuyên cung cấp những sản phẩm cho người chơi trong chuyến hành trình dài. Thử ghé shop tôi xem nào.\",\n    \"npc\": \"28\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"200\",\n    \"exp\": \"200\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(12, 12, '{\n    \"ten\": \"Rương đồ\",\n    \"text\": \"...\",\n    \"text2\": \"Balo của cậu có vẻ nặng quá nhỉ ? Nếu cậu không mang nổi chúng hãy tới đây và gửi lại chúng cho tôi. Tôi sẽ giúp cậu giữ chúng miễn phí. Nếu cậu muốn chọn Thị Trấn này làm điểm mỗi khi chết thì hãy lưu tòa độ tại tôi.\",\n    \"npc\": \"44\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"200\",\n    \"exp\": \"200\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(13, 13, '{\n    \"ten\": \"Thức ăn\",\n    \"text\": \"...\",\n    \"text2\": \"Chào cậu bé, quán tôi chuyên cung cấp độ ăn nhanh đây ! Pokemon của cậu sẽ không lo hết HP khi sử dụng thức ăn của chúng tôi. Hãy ghé lại khi cậu cần lương thực.\",\n    \"npc\": \"30\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"200\",\n    \"exp\": \"200\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(14, 14, '{\n    \"ten\": \"Kĩ năng\",\n    \"text\": \"\",\n    \"text2\": \"Kĩ năng với mỗi PokeMon là vô cùng quan trọng, và việc lựa chọn kĩ năng phù hợp với pokemon càng quan trọng hơn. Khi pokemon đạt cấp độ 5-10-15-20-25-30-35-40-45-50-60... hãy tới gặp tôi để được học miễn phí kĩ năng.\",\n    \"npc\": \"31\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"200\",\n    \"exp\": \"200\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(15, 15, '{\n    \"ten\": \"Trang bị\",\n    \"text\": \"\",\n    \"text2\": \"Heyyyyy, trang bị sẽ giúp pokemon của bạn trở nên mạnh hơn. Chỗ tôi có bán trang bị, khi cần thì tới gặp tôi nhé.\",\n    \"npc\": \"32\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"200\",\n    \"exp\": \"200\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(16, 16, '{\n    \"ten\": \"Thời trang\",\n    \"text\": \"\",\n    \"text2\": \"Thời trang không chỉ giúp bạn trở nên lộng lẫy mà còn giúp pokemon mạnh mẽ hơn !!!! Cần thiết thì tới tôi nhé.\",\n    \"npc\": \"34\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"200\",\n    \"exp\": \"200\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(17, 17, '{\n    \"ten\": \"Mua thức ăn\",\n    \"text\": \"Cậu muốn thử chút thức ăn không ? hãy 2 quả mai vàng xem nào.\",\n    \"text2\": \"Tốt, giờ sử dụng chúng nó nào.\",\n    \"npc\": \"30\",\n    \"loai\": \"muavp\",\n    \"pokemon\": \"1\",\n    \"can\": \"2\",\n    \"xu\": \"200\",\n    \"exp\": \"200\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(18, 18, '{\n    \"ten\": \"Sử thức ăn\",\n    \"text\": \"hãy mở rương đồ => chọn Quả mai vàng => Sử dụng nhé.\",\n    \"text2\": \"Giờ cậu sẵn sàng rồi đó.\",\n    \"npc\": \"30\",\n    \"loai\": \"dungvp\",\n    \"pokemon\": \"1\",\n    \"can\": \"1\",\n    \"xu\": \"200\",\n    \"exp\": \"200\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(19, 19, '{\r\n    \"ten\": \"Thịt  Cleffa\",\r\n    \"text\": \"Hey, cậu rảnh không ? Lũ pokemon cleffa có một lượng thịt rất lớn. Giúp tôi nhặt 50 thịt cleffa nhé.\",\r\n    \"text2\": \"Nhìn thịt của chúng kìa, ngon tuyệt vời.\",\r\n    \"npc\": \"30\",\r\n    \"loai\": \"item\",\r\n    \"pokemon\": \"1\",\r\n    \"can\": \"50\",\r\n    \"xu\": \"3000\",\r\n    \"exp\": \"3000\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"1:2\",\r\n    \"item\": \"54:30\"\r\n}'),
(20, 20, '{\n    \"ten\": \"Rèn luyện\",\n    \"text\": \"Heyyyyy chàng trai trẻ, muốn rèn luyện chút gì đó không ? Hãy đánh bại 40 Odish đi nào ! Ta sẽ thưởng cho cậu xứng đáng.\",\n    \"text2\": \"Cũng nhanh đó nhỉ ! Được, đây là phần thưởng xứng đáng dành cho cậu.\",\n    \"npc\": \"31\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"2\",\n    \"can\": \"40\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"40:50\",\n    \"item\": \"\"\n}'),
(21, 21, '{\n    \"ten\": \"Mua bóng\",\n    \"text\": \"Cậu đã thử bắt pokemon chưa ? Chưa phải không ? Vậy thì hãy mua 2 quả bóng Poke Ball rồi quay lại tìm tôi.\",\n    \"text2\": \"Giờ chắc ta nghĩ cậu đoán được công việc tiếp theo của mình rồi đó.\",\n    \"npc\": \"28\",\n    \"loai\": \"muavp\",\n    \"pokemon\": \"10\",\n    \"can\": \"2\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"10:5\",\n    \"item\": \"\"\n}'),
(22, 22, '{\n    \"ten\": \"Thử PokeBall\",\n    \"text\": \"Giờ cậu đã có bóng rồi sao cậu không thử đi bắt thử một người bạn đồng hành mới nhỉ ? Cậu hãy thử bắt 1 pokemon bất kì nhé. Để bắt pokemon cậu hãy click vào con pokemon đó rồi vào rương chọn bóng và sử dụng nhé. Pokemon bắt dễ hơn khi gần hết máu nhé.\",\n    \"text2\": \"Chà, tôi nghĩ cũng chã khó khăn gì với công việc này đâu nhỉ... haha.\",\n    \"npc\": \"28\",\n    \"loai\": \"bat\",\n    \"pokemon\": \"0\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"10:5\",\n    \"item\": \"\"\n}'),
(23, 23, '{\n    \"ten\": \"Đồi cây tret\",\n    \"text\": \"Tôi nghe kể cậu đã đi qua vùng Đồi Cây Stret, nghe nói ở đó có loài lợn rừng rất tuyệt. Cậu hãy đến đó thử xem.\",\n    \"text2\": \"Kết quả đúng như những gì tôi nghĩ.\",\n    \"npc\": \"30\",\n    \"loai\": \"map\",\n    \"pokemon\": \"2\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(24, 24, '{\n    \"ten\": \"Tiệc đêm\",\n    \"text\": \"Tối nay thị trấn có mở một bữa tiệc rất thịnh soạng, nhưng cửa hàng chúng tôi còn ít thịt quá, chỗ thịt hôm trước cậu kiếm cho tôi đã sử dụng hết, cậu hãy tới Đồi cây Stret mang cho tôi 100 miếng thịt của loài Slakoth về giúp tôi nhé.\",\n    \"text2\": \"Chỗ thịt nhiều hơn tôi tưởng tượng, cám ơn cậu nhé. Tối nay hãy ở lại làng để chung vui với chúng tôi.\",\n    \"npc\": \"30\",\n    \"loai\": \"item\",\n    \"pokemon\": \"3\",\n    \"can\": \"100\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"1:3\",\n    \"item\": \"55:10\"\n}'),
(25, 25, '{\n    \"ten\": \"Gặp\",\n    \"text\": \"....\",\n    \"text2\": \"Proburn vừa gặp ta lúc cháu đi qua khu rừng Stet, anh ta gửi lời tới cháu là hãy nhanh chóng gặp anh ta nhé.\",\n    \"npc\": \"29\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"0\",\n    \"xu\": \"100\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(26, 26, '{\n    \"ten\": \"Chào\",\n    \"text\": \"Thì ra em là người mới tới đây hả ? Anh nghe nói em khá tài giỏi ? Vậy muốn khiêu chiến thử với anh không ?\",\n    \"text2\": \"Anh chịu thua ! Em đánh bại được anh là em cũng tài giỏi đó.\",\n    \"npc\": \"127\",\n    \"loai\": \"gym\",\n    \"pokemon\": \"2\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(27, 27, '{\n    \"ten\": \"Tiếp tục\",\n    \"text\": \".........\",\n    \"text2\": \"Cháu đã ở đây mấy ngày rồi đó ! Mau quay lại gặp OSK để báo cáo lại tình hình đi. Không ông ý lo lắng.\",\n    \"npc\": \"29\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"10000\",\n    \"exp\": \"100\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(28, 28, '{\n    \"ten\": \"Báo cáo\",\n    \"text\": \".........\",\n    \"text2\": \"Mấy ngày không gặp mà trông cháu đã trưởng thành hơn nhiều rồi nhỉ ? Ta nghĩ giờ cháu có thể đi chinh phục mọi miền đất rồi đó ! Trước khi đi thì hãy quay lại Thị Trấn chào mọi người rồi hẳn đi nhé.\",\n    \"npc\": \"125\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"10000\",\n    \"exp\": \"100\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(29, 29, '{\n    \"ten\": \"Lên đường\",\n    \"text\": \".........\",\n    \"text2\": \"Giờ cậu phải đi rồi à ? Khá buồn nhỉ ! Thôi không sao ! Chúc cậu may mắn nhé. Tôi vừa chuẩn bị cho cậu ít đồ đây.\",\n    \"npc\": \"30\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"10000\",\n    \"exp\": \"100\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(30, 30, '{\n    \"ten\": \"Tạm biệt\",\n    \"text\": \".........\",\n    \"text2\": \"Ta nghe tin từ Osk giờ cháu phải lên đường rồi đúng không ? Ta có món quà nho nhỏ tặng cháu ! Hãy sử dụng nó hợp lí nhé. Chúc cháu may mắn.\",\n    \"npc\": \"29\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"10000\",\n    \"exp\": \"100\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"56:1\",\n    \"item\": \"\"\n}'),
(31, 31, '{\r\n    \"ten\": \"Giúp đỡ\",\r\n    \"text\": \"Chà, nhìn bạn có một sức mạnh tuyệt vời ! Chắc hẳn bạn là một huấn luyện viên đúng không nào ? Nếu đúng thì hãy giúp tôi tiêu diệt ít loài chuột với, dạo này chúng cứ phá hoại nhà tôi. Hãy đánh đuổi giúp tôi 100 con Azurill nhé.\",\r\n    \"text2\": \"Quả đúng thật là một huấn luyện viên tài giỏi, nhìn lũ chuột xem... chúng chạy mất dép.\",\r\n    \"npc\": \"45\",\r\n    \"loai\": \"pokemon\",\r\n    \"pokemon\": \"4\",\r\n    \"can\": \"100\",\r\n    \"xu\": \"1000\",\r\n    \"exp\": \"1000\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"\"\r\n}'),
(32, 32, '{\n    \"ten\": \"Giúp đuổi\",\n    \"text\": \"Chào cháu, cháu đang lên đường tới Lodgepole Town phải không ? Đường từ đó còn rất dài, trời sắp tối rồi nên cháu hãy ở lại đây. Nhưng trước tiên hãy đánh đuổi giúp cô 50 bọn chuột Glameow để tối nay chúng không phá hoại nữa nhé.\",\n    \"text2\": \"Giờ thì hãy nghỉ ngơi để mai lên đường nhé.\",\n    \"npc\": \"46\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"5\",\n    \"can\": \"50\",\n    \"xu\": \"5000\",\n    \"exp\": \"5000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"49:3\",\n    \"item\": \"\"\n}'),
(33, 33, '{\n    \"ten\": \"Bị trộm\",\n    \"text\": \"Hey, cậu nhìn thấy lũ chuột đáng ghét ngoài kia không ? Chúng đã lấy trộm của tôi viên huy hiệu Steelixite. Cậu giúp tôi tìm lại nó được không ? Hãy đánh lũ chuột Glarmeow xem con nào đang giữ huy hiệu của tôi.\",\n    \"text2\": \"WOWWW.... đúng là huy hiệu của tôi rồi. Cám ơn cậu.\",\n    \"npc\": \"129\",\n    \"loai\": \"item\",\n    \"pokemon\": \"5\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"49:1\",\n    \"item\": \"57:5\"\n}'),
(34, 34, '{\n    \"ten\": \"Vice City\",\n    \"text\": \"Cậu nghe nói về thành phố hiện đại Vice City chưa ? Nơi đó toàn những cao thủ về huấn luyện viên PokeMon. Ta nghĩ nơi đó chính là đích đến dừng chân tiếp theo của cậu ! Nhưng trước tiên... cậu phải chiến thắng ta trước đã.\",\n    \"text2\": \"Haha, cậu tài giỏi lắm ! Nhưng vẫn cần phải rèn luyện nhiều hơn ! Giờ hãy tiếp tục chuyến hành trình của mình đi nào.\",\n    \"npc\": \"129\",\n    \"loai\": \"gym\",\n    \"pokemon\": \"4\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(35, 35, '{\n    \"ten\": \"Kí túc\",\n    \"text\": \"Cậu là người đến từ vùng núi phía tây tới đây à ? sao ? cậu muốn xin dừng chân ở đây vài ngày ư ? Được thôi ! Nhưng cậu muốn nghỉ ở đây thì phải hạ gục 50 lũ khỉ Mankey ở Đường Ngang.\",\n    \"text2\": \"Cám ơn cậu, giờ thì cậu cứ thoãi mãi nghỉ ngơi đi nhé.\",\n    \"npc\": \"51\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"6\",\n    \"can\": \"50\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(36, 36, '{\n    \"ten\": \"Quà tặng\",\n    \"text\": \"Phía đông thị trấn có một loài igglybuff có những quả trứng rất ngon và bổ dưỡng. Cậu có thể giúp tôi đánh bại chúng và lấy 50 quả trứng igglybuff về đây được không ?\",\n    \"text2\": \"Cám ơn cậu nhé. Giờ cậu hãy mang số trứng này tới gặp Joden và gửi cho cô ấy nhé.\",\n    \"npc\": \"52\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"7\",\n    \"can\": \"50\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"58:50\",\n    \"item\": \"58:40\"\n}'),
(37, 37, '{\r\n    \"ten\": \"Trứng\",\r\n    \"text\": \"....\",\r\n    \"text2\": \"AAAA.... thì ra là quà của Tan, anh gửi lời cám ơn giúp em tới TAN nhé. Tan cho nhiều vậy thì bao giờ em ăn mới hết.\",\r\n    \"npc\": \"54\",\r\n    \"loai\": \"tangqua\",\r\n    \"pokemon\": \"\",\r\n    \"can\": \"50\",\r\n    \"xu\": \"1000\",\r\n    \"exp\": \"0\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"58:0\"\r\n}'),
(38, 38, '{\n    \"ten\": \"Giao thư\",\n    \"text\": \".......\",\n    \"text2\": \"Cậu đang rảnh phải không ? hãy đem giúp tôi các bức thư này gửi tới họ nhé.\",\n    \"npc\": \"51\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"59:3\",\n    \"item\": \"\"\n}'),
