(42, 42, '{\n    \"ten\": \"Chuột đồng\",\n    \"text\": \"Đi về phía đông là sẽ thấy một cánh đồng lớn của ta, cánh đồng đó dạo này bị lũ pokemon Rattata phá hoại kinh khủng. Ta đau lưng quá nên không thể đi lại được, cậu giúp ta đánh đuổi chúng đi nhé.\",\n    \"text2\": \"Chết tiệt, chúng có làm cho cậu bị thương không. Cám ơn cậu nhé.\",\n    \"npc\": \"50\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"8\",\n    \"can\": \"50\",\n    \"xu\": \"10000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(43, 43, '{\n    \"ten\": \"Đi thôi\",\n    \"text\": \"...\",\n    \"text2\": \"Giờ cậu phải lên đường rồi hả ! Chúc cậu lên đường mạnh khỏe nhé.\",\n    \"npc\": \"51\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"500\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(44, 44, '{\n    \"ten\": \"Rèn luyện\",\n    \"text\": \"Ta thấy cậu còn quá yếu ! Hãy thử rèn luyện nhân vật chính tới cấp 8 rồi quay lại gặp ta.\",\n    \"text2\": \"Cậu đi lâu thật ! Ta đợi hơn vài tiếng rồi đó.\",\n    \"npc\": \"135\",\n    \"loai\": \"level\",\n    \"pokemon\": \"\",\n    \"can\": \"8\",\n    \"xu\": \"10000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(45, 45, '{\r\n    \"ten\": \"MẬt Tyrogue\",\r\n    \"text\": \"Lũ tyrovue ơ ngay trước mắt cậu có một lượng mật rất lớn, cậu giúp tôi thu thập ít lượng mật từ chúng được không ?\",\r\n    \"text2\": \"Cám ơn cậu, với chỗ này tôi có thể sử dụng trong vòng 1 năm.\",\r\n    \"npc\": \"135\",\r\n    \"loai\": \"item\",\r\n    \"pokemon\": \"8888\",\r\n    \"can\": \"200\",\r\n    \"xu\": \"10000\",\r\n    \"exp\": \"1000\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"47:1\",\r\n    \"item\": \"60:40\"\r\n}'),
(46, 46, '{\n    \"ten\": \"Đánh bại\",\n    \"text\": \"Muốn đi tiếp phải đánh bại tôi.\",\n    \"text2\": \"Tôi xin chịu thua, mời cậu đi tiếp.\",\n    \"npc\": \"136\",\n    \"loai\": \"gym\",\n    \"pokemon\": \"11\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(47, 47, '{\n    \"ten\": \"Thằng kia\",\n    \"text\": \"Nhãi ranh, có giỏi thì đánh bại ta đi ? Nếu không ta sẽ cho người chết.\",\n    \"text2\": \"Đ...ượ....c đến Vice City ngươi sẽ không thoát đâu.\",\n    \"npc\": \"137\",\n    \"loai\": \"gym\",\n    \"pokemon\": \"12\",\n    \"can\": \"1\",\n    \"xu\": \"10000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(48, 48, '{\n    \"ten\": \"Thử sức 1\",\n    \"text\": \"Hey ! cậu muốn thử chuỗi nhiệm vụ đặc biệt của tôi không ? Đầu tiên hãy tiêu diệt 500 pokemon Sentret và tuyệt đối không để con nào chạy thoát.\",\n    \"text2\": \"Khá lắm ! chuẩn bị vào bài thử sức thứ 2 nào.\",\n    \"npc\": \"138\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"9\",\n    \"can\": \"500\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(49, 49, '{\n    \"ten\": \"Thử sức 2\",\n    \"text\": \"Lần này sẽ tăng mức độ khó hơn nhé. Hãy cận thận nha. Tiêu diệt 700 con Wurmple.\",\n    \"text2\": \"Rất tốt, đúng như những gì ta nghĩ.\",\n    \"npc\": \"128\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"10\",\n    \"can\": \"700\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(50, 50, '{\n    \"ten\": \"Thử sức 3\",\n    \"text\": \"Lần này sẽ ở mức độ cao hơn nữa. Hãy thu thập 300 chìa khóa từ pokemon Starly.\",\n    \"text2\": \"Cám ơn cậu ! Ta còn một bài huấn luyện nữa cho cậu.\",\n    \"npc\": \"128\",\n    \"loai\": \"item\",\n    \"pokemon\": \"11\",\n    \"can\": \"300\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"61:30\"\n}'),
(51, 51, '{\n    \"ten\": \"Bài cuối\",\n    \"text\": \"Chắc cậu cũng mệt lắm rồi phải không ? Đây là bài cuối cùng. Hãy đánh bại Alder 50 lần nhé.\",\n    \"text2\": \"Haha, qua các bài luyện tập của tôi thì cậu trở nên mạnh mẽ hơn nhiều rồi đó.\",\n    \"npc\": \"138\",\n    \"loai\": \"gym\",\n    \"pokemon\": \"13\",\n    \"can\": \"50\",\n    \"xu\": \"100000\",\n    \"exp\": \"10000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"53:1\",\n    \"item\": \"\"\n}'),
(52, 52, '{\n    \"ten\": \"Chào mừng\",\n    \"text\": \"Chào mừng cậu ghé đến làng, cậu có thể thoãi mái nghỉ chân tại làng tôi ! Xin lỗi, nhưng cậu có thể tốc lực tiêu diệt giúp tôi tiêu diệt 50 pokemon Pidove được chứ ?\",\n    \"text2\": \"Cám ơn cậu nhiều lắm.\",\n    \"npc\": \"\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"12\",\n    \"can\": \"50\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(53, 53, '{\n    \"ten\": \"Patrat\",\n    \"text\": \"Hey, cậu đi về phía tây của làng và đi lên hướng bắc sẽ tới cao Nguyên Palm. Nơi này có loài pokemon Patrat rất nguy hiểm cho những người đi qua. Hãy tiêu diệt chúng để không gây hại cho người khác nhé. \",\n    \"text2\": \"Haha, giờ thì người đi qua sẽ không sợ bị chúng tấn công nữa.\",\n    \"npc\": \"73\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"13\",\n    \"can\": \"50\",\n    \"xu\": \"100000\",\n    \"exp\": \"100\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"10:3\",\n    \"item\": \"\"\n}'),
(54, 54, '{\n    \"ten\": \"Lỡ tay\",\n    \"text\": \"Có chuyện lớn rồi. Hôm trước cậu tiêu diệt lũ Patrat không may đã tiêu diệt luôn pokemon của Toebin khiến hắn rất tức giận, và phá hoại hết những đồi cây của làng ta. Cậu hãy giúp tôi dạy cho hắn một bài học nhé.\",\n    \"text2\": \"Cám ơn cậu, từ giờ chắc hắn không dám làm loạn nữa đâu.\",\n    \"npc\": \"73\",\n    \"loai\": \"gym\",\n    \"pokemon\": \"17\",\n    \"can\": \"1\",\n    \"xu\": \"50000\",\n    \"exp\": \"100\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"10:3\",\n    \"item\": \"\"\n}'),
(55, 55, '{\n    \"ten\": \"Vice City\",\n    \"text\": \"\",\n    \"text2\": \"Cậu là người từ vùng núi phía nam xuống đây ư ? Chà ... đúng là một quãng đường rất là xa luôn đó ! Xin tự giới thiệu ta là Cool, một trong những người lãnh đạo của Vice City. Hãy tới gặp Pilot để đăng kí tạm trú ở đây nhé.\",\n    \"npc\": \"144\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(56, 56, '{\n    \"ten\": \"Ở lại\",\n    \"text\": \"\",\n    \"text2\": \"Tôi nghe giới thiệu, cậu đến từ vùng núi phía nam tới đây ! Tôi là người quản lí dân cư ở đây ! Cậu muốn ở lại đây thì phải đăng kí ! Chúng tôi sẽ sắp xếp chỗ ở cho cậu ! Hãy cứ nghỉ ngơi đi nhé.\",\n    \"npc\": \"147\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(57, 57, '{\n    \"ten\": \"Mua lương thực\",\n    \"text\": \"Cậu định ở đây mấy ngày ? Muốn ở đây thì cậu phải mua một ít lương thực đã. Hãy vào cửa hàng mua 2 quả Mai Trắng đi nào\",\n    \"text2\": \"Tốt, giờ cậu đã có lương thực để ở lại Vice City rồi.\",\n    \"npc\": \"147\",\n    \"loai\": \"muavp\",\n    \"pokemon\": \"2\",\n    \"can\": \"2\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(58, 58, '{\n    \"ten\": \"Rèn luyện\",\n    \"text\": \"Trông cậu còn yếu kém quá ! Hãy quay lại gặp tôi khi cậu đạt cấp độ 15.\",\n    \"text2\": \"Haha, nhanh hơn tôi dự kiến rồi đó.\",\n    \"npc\": \"145\",\n    \"loai\": \"level\",\n    \"pokemon\": \"2\",\n    \"can\": \"15\",\n    \"xu\": \"10000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(59, 59, '{\n    \"ten\": \"Tiêu diệt\",\n    \"text\": \"Cậu đã đặt chân đến vùng đất mang tên Cổng Thiên Giới chưa ? Nếu chưa thì hãy đi về phía đông ngôi thành phố, nơi đó có loài pokemon Bidoof rất kì lạ. Nhân tiện tiêu diệt chúng về đây cho tôi.\",\n    \"text2\": \"Cám ơn cậu nhiều lắm nhé.\",\n    \"npc\": \"145\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"14\",\n    \"can\": \"300\",\n    \"xu\": \"10000\",\n    \"exp\": \"10000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(60, 60, '{\n    \"ten\": \"Cổng thiên giới\",\n    \"text\": \"Này, cậu đã nghe kể về vùng đất phía sau Cổng Thiên Giới chưa ? ta nghe nói đó chính là nơi huyết mạch các vùng đất lại với nhau ! Cậu có muốn thử đến đó không ? Nhưng trước tiên đạt cấp độ 17 trước nhé.\",\n    \"text2\": \"Haha, cũng nhanh đó nhỉ.\",\n    \"npc\": \"147\",\n    \"loai\": \"level\",\n    \"pokemon\": \"17\",\n    \"can\": \"17\",\n    \"xu\": \"10000\",\n    \"exp\": \"10000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(61, 61, '{\n    \"ten\": \"Đi thôi\",\n    \"text\": \"....\",\n    \"text2\": \"Giờ cháu tính đi đến vùng đất phía bên kia của cổng thiên giới hả ! Hmhm ! Ta không giám chắc nhưng nơi đó sẽ là một nơi tuyệt vời đó. Chúc cậu may mắn.\",\n    \"npc\": \"144\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(62, 62, '{\n    \"ten\": \"Chờ đã\",\n    \"text\": \"......\",\n    \"text2\": \"Cậu đang định đi đến vùng đất phía đông đúng không ? Để đi qua đó cậu cần vật phẩm này ! Hãy mang tới gặp lính canh nhé.\",\n    \"npc\": \"144\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"0\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"62:1\",\n    \"item\": \"\"\n}'),
(63, 63, '{\n    \"ten\": \"dừng lại\",\n    \"text\": \"......\",\n    \"text2\": \"Đứng lại .... người lạ không được qua ... à thì ra cháu là người vùng này ! Cháu muốn đi qua đây phải không ? Nhưng đường đã bị sập rồi.\",\n    \"npc\": \"163\",\n    \"loai\": \"tangqua\",\n    \"pokemon\": \"\",\n    \"can\": \"0\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"62:1\"\n}'),
(64, 64, '{\n    \"ten\": \"Nguyên liệu\",\n    \"text\": \"........\",\n    \"text2\": \"Để phá được những hòn đá này chúng ta cần một lượng thuốc nổ lớn. Để chế tạo thuốc nổ chúng ta cần chút nguyên liệu. Cậu hãy gặp May ở Vice City hỏi xem.\",\n    \"npc\": \"163\",\n    \"loai\": \"giaotiep\",\n    \"pokemon\": \"\",\n    \"can\": \"\",\n    \"xu\": \"1000\",\n    \"exp\": \"10000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"\"\n}'),
(65, 65, '{\n    \"ten\": \"Công thức\",\n    \"text\": \"Sao cơ ? Muốn lấy công thức làm pháo hả ? Nhưng muốn lấy thì thắng ta trước rồi tính !\",\n    \"text2\": \"Giỏi lắm ! đây là công thức của cậu.\",\n    \"npc\": \"158\",\n    \"loai\": \"gym\",\n    \"pokemon\": \"18\",\n    \"can\": \"1\",\n    \"xu\": \"100\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"61:1\",\n    \"item\": \"\"\n}'),
(66, 66, '{\r\n    \"ten\": \"Công thức\",\r\n    \"text\": \"....\",\r\n    \"text2\": \"Tốt lắm ! Chúng ta đã hoàn tất được 25% công việc rồi. Giờ hãy tìm Jaden để có nguyên liệu tiếp theo nhé.\",\r\n    \"npc\": \"163\",\r\n    \"loai\": \"tangqua\",\r\n    \"pokemon\": \"18\",\r\n    \"can\": \"1\",\r\n    \"xu\": \"100\",\r\n    \"exp\": \"1000\",\r\n    \"ruby\": \"0\",\r\n    \"vatpham\": \"\",\r\n    \"item\": \"61:1\"\r\n}'),
(67, 67, '{\n    \"ten\": \"Nguyên liệu\",\n    \"text\": \"Chà cậu đang cần nguyên liệu để chế tạo pháo ư ? Được thôi ! Nếu cậu giúp tôi tiêu diệt 500 còn Starly ở Cổng Thiên Giới.\",\n    \"text2\": \"Đây là bột của cậu ! Hãy dùng cận thận nhé.\",\n    \"npc\": \"162\",\n    \"loai\": \"pokemon\",\n    \"pokemon\": \"14\",\n    \"can\": \"500\",\n    \"xu\": \"500\",\n    \"exp\": \"500\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"64:1\",\n    \"item\": \"\"\n}'),
(68, 68, '{\n    \"ten\": \"Bột nổ\",\n    \"text\": \"......\",\n    \"text2\": \"Chúng ta đã gần hoàn thành rồi.\",\n    \"npc\": \"163\",\n    \"loai\": \"tangqua\",\n    \"pokemon\": \"\",\n    \"can\": \"1\",\n    \"xu\": \"1000\",\n    \"exp\": \"1000\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"64:1\"\n}'),
(69, 69, '{\n    \"ten\": \"Nguyên liệu cuối\",\n    \"text\": \"Hey, vậy là cậu đã có đủ nguyên liệu rồi, chỉ còn thiếu đúng ngòi dây thôi. Hãy đánh bại lũ Bidoof và kiếm 10 sợi lông của chúng về đây ! Tôi sẽ giúp cậu phá đá.\",\n    \"text2\": \"Tôi và vừa kích nổ các viên đá, giờ cậu có thể đi qua vùng đất phía bên kia. Chúc cậu may mắn\",\n    \"npc\": \"163\",\n    \"loai\": \"item\",\n    \"pokemon\": \"14\",\n    \"can\": \"10\",\n    \"xu\": \"100\",\n    \"exp\": \"100\",\n    \"ruby\": \"0\",\n    \"vatpham\": \"\",\n    \"item\": \"65:1\"\n}');
